import React from 'react'
var commaNumber = require('comma-number')

function SingleStock (props) {
  return (
    <tr>
    {console.log(props)}
      <td className={(props.price.toFixed(2) > props.openPrice) ? 'red' : (props.price == props.openPrice) ? 'gray' : 'green'}>
        {props.symbol}
      </td>
      <td>
        {props.shares} shares
      </td>
      <td className={(props.price > props.openPrice) ? 'red' : (props.price == props.openPrice) ? 'gray' : 'green'}>
        $ {commaNumber((props.shares * props.price).toFixed(2))}
      </td>
    </tr>
  )
}

export default SingleStock
